def invoke(msg)  {

    def withResponse = new JsonSlurper().parseText(msg.get("with-content.body"))
    def withoutResponse = new JsonSlurper().parseText(msg.get("without-content.body"))
	
    if (withResponse.error || withoutResponse.error) {
        return false
    }
    else {

        def supplyPlanResp = [:]
		
        def SP = [:]
		def Orders = [:]
		def businessPartner = [:]
        def rebateStatementDetail = [:]
