		//}

		//results = withResponse.records.groupBy{it.Parent_Order_vod__r.Name}


		if( withResponse.records[1] ) {
			businessPartner["id"]=msg.get("params.path.id");	
			businessPartner["name"]=withResponse.records[1].Account_vod__r.Name;
		} else if( withoutResponse.records[1]  ) {
			businessPartner["id"]=msg.get("params.path.id");	
			businessPartner["name"]=withoutResponse.records[1].Account_vod__r.Name;
		} else {
			//return empty
			def generator = new groovy.json.JsonGenerator.Options()
										.excludeNulls()
										.build()

			def builder = new JsonBuilder(supplyPlanResp, generator) 
			//print JsonOutput.prettyPrint (builder.toString())
			msg.put ('SP.response', builder)
			return true
		}
		
		supplyPlanResp["businessPartner"] = businessPartner;
		
				
		withResponse.records.groupBy{it.Parent_Order_vod__r.Name}.each { key, value -> 
			SP = [:]
			SP["id"] = key
			SP["createdDate"] = value[0].CreatedDate
			orderList = []
			value.each{ ordersRec->
				Orders = [:]
				Orders["orderId"] = ordersRec.Name
				Orders["orderStatusCode"] = ordersRec.Delivery_Status_BI__c
				Orders["plannedDelivery"] = ordersRec.Delivery_Date_Formatted_BI__c
				businessPartner = [:];
				wholesaler = [:]
				wholesaler["city"]=ordersRec.Ship_To_Address_vod__r.City_vod__c
				wholesaler["streetName"]=ordersRec.Ship_To_Address_vod__r.Name
				wholesaler["zip"]=ordersRec.Ship_To_Address_vod__r.Zip_vod__c
				businessPartner["address"]=wholesaler;
				Orders["ship-ToCustomer"] = businessPartner;
				orderList << Orders
			}
			SP["orders"] = orderList
			SP["templateUrl"] = value[0].Order_Campaign_vod__r.Name
			businessPartner = [:];
			businessPartner["organizationName"]=value[0].Wholesaler_Account_Partner_vod__r.Name;
			SP["wholesalerCustomer"] = businessPartner;
				
			SPList << SP
		}
			
		withoutResponse.records.each { records -> 
			SP = [:]
			SP["id"] = records.Name
			SP["createdDate"] = records.CreatedDate
			orderList = []
			Orders = [:]
			Orders["orderId"] = records.Name
			Orders["orderStatusCode"] = records.Delivery_Status_BI__c
			Orders["plannedDelivery"] = records.Delivery_Date_Formatted_BI__c
			businessPartner = [:];
			wholesaler = [:]
			wholesaler["city"]=records.Ship_To_Address_vod__r.City_vod__c
