			Orders["ship-ToCustomer"] = businessPartner;
			orderList << Orders
			SP["orders"] = orderList
			SP["templateUrl"] = records.Order_Campaign_vod__r.Name
			businessPartner = [:];
			businessPartner["organizationName"]=records.Wholesaler_Account_Partner_vod__r.Name;
			SP["wholesalerCustomer"] = businessPartner;
			
			SPList << SP
		}
		
		supplyPlanResp["supplyPlan"] = SPList
		
