	def translateDate(value){
		if (value) {
			Date date = Date.parse("yyyyMMdd",value)
			def dateFormat = new SimpleDateFormat(/yyyy-MM-dd/)
			return dateFormat.format(date)
		}
		else {
			return null
		}
	}
	
	def translateDateTime(value){
		if (value) {
			def dateFormat = new SimpleDateFormat(/yyyy-MM-dd'T'HH:mm:ssXXX/)
			dateFormat.setTimeZone(TimeZone.getTimeZone("EST"))
			def dateMatch = value =~ /\/Date\((\d+)(\+\d+)?\)/
			if (dateMatch) {
				def date = new Date()
				date.setTime(dateMatch[0][1] as Long)
				return dateFormat.format(date)
			}else {
				return next.translateDate(value)
			}
		}
		else {
			return null
		}
	}

