urlWITH+="+from+Order_vod__c+where+LastModifiedDate"
urlWITH+=URLEncoder.encode(">=")
urlWITH+=URLDecoder.decode(modifiedFrom)+"+AND+Account_vod__r.BI_External_ID_2__c='"+countryId+"'+AND+parent_order_vod__c"+URLEncoder.encode("<>")+"null+"
