urlWITH+="AND+(Parent_Order_vod__r.status_vod__c='Submitted_vod'+OR+(Parent_Order_vod__r.status_vod__c='Saved_vod'+AND+Parent_Order_vod__r.ready_for_process_bi__c=true))"

urlWITHOUT+="select+id,+name,+Account_vod__r.BI_External_ID_2__c,+Parent_Order_vod__r.name,+CreatedDate,+Delivery_Date_Formatted_BI__c,+Delivery_Status_BI__c,+Order_Campaign_vod__r.name,"
