urlWITHOUT+="+from+Order_vod__c+where+LastModifiedDate"
urlWITHOUT+=URLEncoder.encode(">=")
urlWITHOUT+=URLDecoder.decode(modifiedFrom)+"+AND+Account_vod__r.BI_External_ID_2__c='"+countryId+"'+AND+parent_order_vod__c=null+"
urlWITHOUT+="AND+master_order_vod__c=false+AND+recordtype.name='Transfer_vod'+AND+(status_vod__c='Submitted_vod'+OR+(status_vod__c='Saved_vod'+AND+ready_for_process_bi__c=true))+AND+isdeleted=false+AND+buying_group_master_order_bi__c=false"


